import React from "react";
import {
  BrowserRouter,
  Routes,
  Route,
  Link
} from "react-router-dom";import Contact from './contact';
import Home from './home'
import Navbar from './navbar'

function App() {

  return (
    <BrowserRouter>
      <Router>
        <Navbar />
        <Routes>
        <Route path='/' exact element={Home} />
        <Route path='/contact' exact element={Contact} />
        </Routes>
      </Router>
   </BrowserRouter>
  );
};

export default App;
